class Solution(object):
    def numRescueBoats(self, people, limit):
        """
        :type people: List[int]
        :type limit: int
        :rtype: int
        """
        people.sort()
        print(people)
        left = 0
        right = len(people) - 1
        boatsNum = 0
        while left < right:
            if people[left] + people[right] <= limit:
                left += 1
                right -= 1
                boatsNum += 1
            else:
                right -= 1
                boatsNum += 1
        boatsNum += 1
        print(boatsNum)


